import React from 'react';
import Header from "../Layouts/Header/Header"
import Profile from "../Profile/Profile"

function Home() {

  return (
    <div className='profile__wrapper'>
        <Header></Header>
        <BrowserRouter>
        <Routes>
          <Route path="/profile" element={<Profile />}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default Home;
